import React from "react";

const Movies = ({ genres, top }) => {
  return (
    <>
      {genres.map((genre) => (
        <div className="btn" key={genre.id}>
          {genre.name}
        </div>
      ))}
<div>
  {top.map((topmovies))}
</div>
      </>
  );
};

export default Movies;
